import React from "react";
function TeamMember(props) {
    return (
        <div className="col-md-4  ">
            <div className="card h-100">
                <div className="card-header">
                    {/* <img className="rounded mx-auto d-block " src={props.info.img} alt="image" style={{width:'100%'}}></img> */}
                </div>
                <div className="card-body">
                    <h2>{props.info.name}</h2>
                    <h5>{props.info.position}</h5>
                    <div>{props.info.phone}</div>
                    <div>{props.info.email?props.info.email:"has no email"}</div>
                    <div>{props.info.website}</div>
                </div>

            </div>
        </div>
    );
}
export default TeamMember;
